import Wrapper from "../Components/Wrapper/index"
import "./style.css"
import Project from "../Components/Projects/index";

class Home extends Component{
    state = {

    };

    render(){
        return (
        <Wrapper>

        <Grid container  spacing = {24}>
            <Grid item xs={12} className="personal-container">
                <h1>About Me</h1>
                <p > Aspiring software engineer with a background in mechanical engineering and minor in computer science. Proficient in programming languages such as Python, Javascript, SQL. and other Web based technologies. I am always hungry to learn and develop my skills as I am on the tech career path.</p>
            </Grid>

            <Grid item xs={12}>
                <Project/>          
            </Grid>

            <Grid item xs={12} className="contact-container">
                <h1>Contact Info</h1>
                <ul>
                    <li><i class="fa fa-linkedin-square" style="font-size:24px"></i></li>
                    <li><i class="fab fa-github"></i></li>
                </ul>

            </Grid>
        </Grid>

        </Wrapper>
        )

    }


}

export default Home;
